import React from 'react';

class Avatar extends React.Component {
  render() {
    return (
      <div>
        <img
          className='Hall9000'
          src='https://www.google.com/imgres?imgurl=https%3A%2F%2Fvignette.wikia.nocookie.net%2F2001%2Fimages%2Fa%2Fa5%2FEE46A295-E2F9-4619-ABF4-E5BE0D31C0E3.jpeg%2Frevision%2Flatest%3Fcb%3D20190114052106&imgrefurl=https%3A%2F%2F2001.fandom.com%2Fwiki%2FHAL_9000&tbnid=MfttPePwdtXI4M&vet=12ahUKEwin863V8PzpAhUKpBoKHVIlBYUQMygEegUIARDeAQ..i&docid=jSG5V-yPjKBVWM&w=1920&h=1200&q=hal9000&client=ubuntu&ved=2ahUKEwin863V8PzpAhUKpBoKHVIlBYUQMygEegUIARDeAQ'
          alt='Hal9000'
        />
      </div>
    );
  }
}

export default Avatar;
